import React from "react";
import { useState, useEffect } from "react";
import logo from "./logo.svg";
import "./App.css";
import Searchbar from "./components/Searchbar"

function App() {

  const [searchTerm, setSearchTerm] = useState("");

  const handleInputChange = (event) => {
  setSearchTerm(event.target.value);
  }
  
  return (
      <div className="container">
      <div className = "navbar">
        <div className = "searchbar" type>
      <i className="fa-solid fa-magnifying-glass"></i></div>
      <input
            type="text"
            placeholder="Search..."
            value={searchTerm} // Postavlja vrednost inputa na state
            onChange={handleInputChange} // Ažurira state na promenu
          />
      </div>
      <div className = "main">
        <div className = "mainLeft"></div>
        <div className = "mainRight"></div>
      </div>
    </div>
  );
}

export default App;
